from collections import defaultdict

ordA = ord("a")


def toIndex(c):
    return ord(c) - ordA


def toSignature(s):
    signature = [0] * 26
    for c in s:
        signature[toIndex(c)] += 1
    return list(filter(lambda x: x > 0, signature))


def isValid(s):
    signature = toSignature(s)
    freqDict = defaultdict(list)

    for i in range(len(signature)):
        freqDict[signature[i]].append(i)
    keys = list(freqDict.keys())
    if len(keys) == 1:
        return "YES"
    if len(keys) == 2:
        shortKey = None
        longKey = None
        for k in keys:
            if len(freqDict[k]) == 1:
                shortKey = k
            else:
                longKey = k
        if shortKey is None:
            return "NO"
        if shortKey == 1:
            return "YES"
        if abs(longKey - shortKey) == 1:
            return "YES"
    return "NO"


if __name__ == "__main__":
    print(
        "YES: ",
        isValid(
            ""
        ),
    )
